








#![no_implicit_prelude]
#![allow(warnings)]

include!("include.rs");



mod foo {
    use super::*;

    #[derive(imp::FromBytes, imp::IntoBytes, imp::Unaligned)]
    #[repr(C)]
    pub struct Foo {
        foo: u8,
    }

    #[derive(imp::FromBytes, imp::IntoBytes, imp::Unaligned)]
    #[repr(C)]
    pub struct Bar {
        bar: u8,
    }
}

use foo::Foo;

#[derive(imp::FromBytes, imp::IntoBytes, imp::Unaligned)]
#[repr(C)]
struct Baz {
    foo: Foo,
    bar: foo::Bar,
}
